INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(1, 'Iron Maiden', 'https://twitter.com/IronMaiden', 'https://www.facebook.com/ironmaiden', , 'Iron Maiden are an English heavy metal band formed in Leyton, east London, in 1975 by bassist and primary songwriter Steve Harris. The band''s discography has grown to thirty-seven albums, including fifteen studio albums, eleven live albums, four EPs, and seven compilations.\r\n\r\nPioneers of the New Wave of British Heavy Metal, Iron Maiden achieved initial success during the early 1980s. After several line-up changes, the band went on to release a series of US and UK platinum and gold albums, including 1982''s The Number of the Beast, 1983''s Piece of Mind, 1984''s Powerslave, 1985''s live release Live After Death, 1986''s Somewhere in Time and 1988''s Seventh Son of a Seventh Son. Since the return of lead vocalist Bruce Dickinson and guitarist Adrian Smith in 1999, the band have undergone a resurgence in popularity, with their latest studio offering, The Final Frontier, peaking at No. 1 in 28 different countries and receiving widespread critical acclaim.\r\n\r\nConsidered one of the most successful heavy metal bands in history, Iron Maiden have sold over 85 million records worldwide with little radio or television support. The band won the Ivor Novello Award for international achievement in 2002, and were also inducted into the Hollywood RockWalk in Sunset Boulevard, Los Angeles, California during their United States tour in 2005. As of October 2013, the band have played over 2000 live shows throughout their career. For the past 35 years, the band have been supported by their famous mascot, "Eddie", who has appeared on almost all of their album and single covers, as well as in their live shows.');
INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(2, 'Sabaton', 'https://twitter.com/sabaton', 'https://www.facebook.com/sabaton', , 'Sabaton [?saba?ton] are a heavy metal band from Falun, Sweden formed in 1999. The band''s main lyrical themes are based on war and historical battles. This is heard in albums Primo Victoria, Attero Dominatus and Coat of Arms where all of the songs, except final tracks. Lyrical content drawn from World War I, World War II and other conflicts is prevalent and includes songs about battles and leaders on all sides of said conflicts.\r\n\r\nIn April 2012 four members left the band and formed another, whilst vocalist Joakim Brodén and bassist Pär Sundström continued with new members. As well as extensively touring internationally the band have a festival in their home town of Falun, Sabaton Open Air, in August and an annual cruise, ''Sabaton Cruise'', in November.');
INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(4, 'Alestorm', 'https://twitter.com/alestormband', 'https://www.facebook.com/alestormband', , 'Alestorm is a Heavy Metal band from Perth, Scotland. Their music is characterized by a pirate theme, and as a result they have been dubbed a "pirate metal" band by many critics and their fanbase. They refer to their genre as "True Scottish Pirate Metal".\r\n\r\nThe band formed under the name Battleheart in 2004. After releasing two demos, they were signed by Napalm Records in 2007 and renamed themselves Alestorm. Their debut album was released on 25 January 2008. The band''s third album, Back Through Time, was released in June 2011.');
INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(6, 'Metallica', 'https://twitter.com/Metallica', 'https://www.facebook.com/Metallica', , 'Metallica is an American heavy metal band from Los Angeles, California. The band''s fast tempos, instrumentals, and aggressive musicianship placed them as one of the founding "big four" of thrash metal alongside Slayer, Megadeth, and Anthrax. Metallica was formed in 1981 when James Hetfield responded to an advertisement that drummer Lars Ulrich had posted in a local newspaper. The current line-up features founders Hetfield (vocals, rhythm guitar) and Ulrich (drums), longtime lead guitarist Kirk Hammett and bassist Robert Trujillo, who joined the band in 2003. Previous members of the band are lead guitarist Dave Mustaine, who went on to found Megadeth, bassists Ron McGovney (demos only), Cliff Burton (the first three records, died in 1986), and Jason Newsted. The band also had a long collaboration with producer Bob Rock, who produced all of its albums from 1990 to 2003 and served as a temporary bassist between the departure of Newsted and the hiring of Trujillo.\r\n\r\nThe band earned a growing fan-base in the underground music community and critical acclaim with its first four albums, with their third, Master of Puppets (1986), described as one of the most influential and "heavy" thrash metal albums. Metallica achieved substantial commercial success with their eponymous fifth album (also known as The Black Album), which debuted at number one on the Billboard 200. With this release the band expanded its musical direction resulting in an album that appealed to a more mainstream audience.');
INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(7, 'Linkin Park', 'https://twitter.com/linkinpark', 'https://www.facebook.com/linkinPark', , 'Linkin Park is an American rock band from Agoura Hills, California. Formed in 1996, the band rose to international fame with their debut album Hybrid Theory, which was certified Diamond by the RIAA in 2005 and multi-platinum in several other countries. Their following studio album Meteora, continued the band''s success, topping the Billboard 200 album chart in 2003, and was followed by extensive touring and charity work around the world. In 2003, MTV2 named Linkin Park the sixth-greatest band of the music video era and the third-best of the new millennium. Billboard ranked Linkin Park No. 19 on the Best Artists of the Decade chart. The band was recently voted as the greatest artist of ''00s in a Bracket Madness poll on VH1.\r\n\r\nHaving adapted nu metal and rap metal to a radio-friendly yet densely layered style in Hybrid Theory and Meteora, the band explored other genres in their next studio album, Minutes to Midnight (2007). The album topped the Billboard charts and had the third-best debut week of any album that year. The band continued to explore a wider variation of musical types in their fourth album, A Thousand Suns (2010), layering their music with more electronic sounds and beats. Their most recent work, Living Things (2012), combines musical elements from all of their previous records. The band has collaborated with several other artists, most notably with rapper Jay-Z in their mashup EP Collision Course, and many others on Reanimation and Recharged.'),
(8, 'Rage Against The Machine', 'https://twitter.com/RATM', 'https://www.facebook.com/RATM', , 'Rage Against the Machine, also known as RATM, is an American rap metal band from Los Angeles, California. Formed in 1991, the group consists of rapper/vocalist Zack de la Rocha, bassist and backing vocalist Tim Commerford, guitarist Tom Morello and drummer Brad Wilk. They draw inspiration from early heavy metal instrumentation, as well as rap acts such as Afrika Bambaataa, Public Enemy, the Beastie Boys and Dutch crossover band Urban Dance Squad. Rage Against the Machine is best known for its leftist political views, which are expressed in many of its songs. As of 2010, they have sold over 16 million records worldwide.\r\n\r\nIn 1992, the band released its self-titled debut album, which became a commercial and critical success, leading to a slot in the 1993 Lollapalooza festival. In 2003, the album was ranked number 368 on Rolling Stone magazine''s list of the 500 greatest albums of all time. The band did not release a follow-up record until 1996, with Evil Empire. The band''s third album, The Battle of Los Angeles, followed in 1999, and in 2003, the album was ranked number 426 on the same list. During their initial nine-year run, they became one of the most popular and influential bands in music history, according to music journalist Colin Devenish. They were also ranked No. 33 on VH1''s 100 Greatest Artists of Hard Rock. The band had a large influence on the nu metal genre which emerged during the late 1990s.');
INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(9, 'AC/DC', 'https://twitter.com/AC_DC', 'https://www.facebook.com/acdc', , 'AC/DC are an Australian hard rock band, formed in November 1973 by brothers Malcolm and Angus Young, who have remained constant members. Commonly referred to as a hard rock or blues rock band, they are also considered pioneers of heavy metal and are sometimes classified as such, though they have always dubbed their music as simply "rock and roll". To date they are one of the highest-grossing bands of all time.\r\n\r\nAC/DC underwent several line-up changes before releasing their first album, High Voltage, on 17 February 1975. Membership subsequently stabilised until bassist Mark Evans was replaced by Cliff Williams in 1977 for the album Powerage. Within months of recording the album Highway to Hell, lead singer and co-songwriter Bon Scott died on 19 February 1980 after a night of heavy alcohol consumption. The group briefly considered disbanding, but buoyed by support from Scott''s parents, decided to continue and set about finding a new vocalist. Ex-Geordie singer Brian Johnson was auditioned and selected to replace Scott. Later that year, the band released the new album, Back in Black, which was made as a tribute to Bon Scott. The album launched them to new heights of success and became their all time best-seller, selling over 10,000 copies a day in its first week.');
INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(10, 'Bon Jovi', 'https://twitter.com/BonJovi', 'https://www.facebook.com/BonJovi', , 'Bon Jovi is an American rock band from Sayreville, New Jersey. Formed in 1983, Bon Jovi consists of lead singer and namesake Jon Bon Jovi (John Francis Bongiovi, Jr.), guitarist Richie Sambora, bassist Hugh McDonald, keyboardist David Bryan, and drummer Tico Torres. The band''s lineup has remained mostly static during its history, the only exception being the 1994 dismissal of bass player Alec John Such. In 1986, Bon Jovi achieved widespread global recognition with their third album, Slippery When Wet. The band''s fourth album, New Jersey was equally successful in 1988, and between 1986—1995, Bon Jovi had 13 U.S. Top 40 hits, including four number-one songs on the Billboard Hot 100: "You Give Love a Bad Name", "Livin'' on a Prayer", "Bad Medicine", and "I''ll Be There for You". Other Top 10 record chart hits included "Wanted Dead or Alive", "Born to Be My Baby", "Lay Your Hands on Me", "Bed of Roses" and "Always".\r\n\r\nThe success of Bon Jovi''s 2000 single, "It''s My Life", helped introduce them to a younger audience, as has the use of different styles in their music, such as the appearance of country in 2007''s Lost Highway. Lost Highway debuted at number one on the Billboard 200, as did 2009''s The Circle. On March 12, 2013, Bon Jovi released their 12th studio album, What About Now. Thus far, Bon Jovi has released 12 studio albums, plus three compilations and two live albums. They are one of the world’s best-selling bands of all time, having sold more than 130 million records worldwide, and performed more than 2,700 concerts in over 50 countries for more than 34 million fans. Bon Jovi was inducted into the UK Music Hall of Fame in 2006. The band was also honored with the Award of Merit at the American Music Awards in 2004, and as songwriters and collaborators, Jon Bon Jovi and Richie Sambora were inducted into Songwriters Hall of Fame in 2009.'),
(11, 'Dire Straits', 'https://twitter.com/thestraits', 'https://www.facebook.com/DireStraitsOfficial', , 'Dire Straits were a British rock band, formed in 1977 by Mark Knopfler (lead vocals and lead guitar), his younger brother David Knopfler (rhythm guitar and backing vocals), John Illsley (bass guitar and backing vocals), and Pick Withers (drums and percussion). Dire Straits'' sound drew from a variety of musical influences, including jazz, folk, blues, and came closest to beat music within the context of rock and roll. Despite the prominence of punk rock during the band''s early years, the band''s stripped-down sound contrasted with punk, demonstrating a more "rootsy" influence that emerged from pub rock. Many of Dire Straits'' compositions were melancholic. Dire Straits'' biggest selling album, Brothers in Arms, has sold over 30 million copies.\r\n\r\nThey also became one of the world''s most commercially successful bands, with worldwide album sales of over 120 million. Dire Straits won numerous music awards during their career, including four Grammy Awards, three Brit Awards—winning Best British Group twice, and two MTV Video Music Awards. The band''s most popular songs include "Sultans of Swing", "Lady Writer", "Romeo and Juliet", "Tunnel of Love", "Telegraph Road", "Private Investigations", "Money for Nothing", "Walk of Life", "So Far Away", "Your Latest Trick" and "Brothers in Arms".');
INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(12, 'Sum 41', 'https://twitter.com/Sum41', 'https://www.facebook.com/Sum41', , 'Sum 41 is a Canadian rock band from Ajax, Ontario, Canada. The band was formed in 1996 and currently consists of members Deryck Whibley (lead vocals, rhythm guitar), Tom Thacker (lead guitar, backing vocals), Jason McCaslin (bass guitar, backing vocals). In April 2013, drummer Steve Jocz announced his departure from the band. Sum 41 have sold over 30 million albums worldwide.\r\n\r\nIn 1999, the band signed an international record deal with Island Records. The band released their debut album, All Killer, No Filler in 2001. The band achieved mainstream success with their first single from the album, "Fat Lip", which reached number-one on the Billboard Modern Rock Tracks chart and remains the band''s most successful single to date. All Killer No Filler was certified platinum in the United States, Canada and in the UK. The band has since released four more studio albums: Does This Look Infected? (2002), Chuck (2004) Underclass Hero (2007) and Screaming Bloody Murder (2011).');
INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(13, 'Disturbed', 'https://twitter.com/Disturbed', 'https://www.facebook.com/Disturbed', , 'Disturbed is an American heavy metal band from Chicago, Illinois. The band''s members are vocalist David Draiman, guitarist Dan Donegan, bassist John Moyer, and drummer Mike Wengren. Former band members were vocalist Erich Awalt and bassist Steve "Fuzz" Kmak. Formed in 1994 as Brawl, the band was renamed Disturbed in 1996 after Draiman was hired as the band''s new vocalist. Since the band''s formation, they have sold over 13 million albums worldwide, making them one of the largest grossing metal/rock bands in recent years. The band has released five studio albums, four of which have consecutively debuted at number-one on the Billboard 200. The band went into an indefinite hiatus in October 2011 and the band''s members are currently working on various side projects. The band members insist that they will regroup as Disturbed again sometime in the future.');
INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(14, 'Rammstein', 'https://twitter.com/RammsteinNews', 'https://www.facebook.com/Rammstein', , 'Rammstein is a Neue Deutsche Härte band from Berlin, Germany. The band was formed in 1994 and consists of Till Lindemann (lead vocals), Richard Z. Kruspe (guitar and backing vocals), Paul H. Landers (guitar, backing vocals), Oliver "Ollie" Riedel (bass guitar), Christoph "Doom" Schneider (drums and electronic percussion) and Christian "Flake" Lorenz (keyboards). Since their formation in 1994, Rammstein has had no changes in their band line-up.\r\n\r\nTheir songs are usually in German, but they have also performed songs entirely or partially in other languages such as English, Spanish, French and Russian. As of 2009, they have sold over 30 million records worldwide. Rammstein''s award-winning live shows are known for their pyrotechnic performance and theatrics. Rammstein''s entire catalogue is published by Universal Music Group.');

